import React from 'react';
import PropTypes, { func } from 'prop-types';
import Link from 'next/link';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/index">
          <a>노드버드</a>
        </Link>
        <Link href="/profile">
          <a>프로필</a>
        </Link>
        <Link href="/signup">
          <a>회원가입</a>
        </Link>
        <Link href="/contact">
          <a>컨텐츠</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.PropTypes = {
  children: PropTypes.node.inRequired,
};

export default AppLayout;
